(60, '382207342770', 'photos', '2016-02-23 15:00:31', '2016-02-23 15:00:31', '[{"created_time":"2016-01-11T16:30:23+0000","name":"Fant\\u00e1ts, le principali testate musicali hanno ascoltato e recensito #VaiFradi! I primi sono i ragazzi di @RumoreMagazine :) @carnicats @dekillceesa #ReddArmy #DoroGjat #carnia #cjargne #fvg","id":"10153587223682771"},{"created_time":"2016-01-09T17:01:51+0000","name":"Sul #messaggeroveneto di oggi mi hanno chiesto come \\u00e8 andata questa faccenda di @studioaperto e io glie l''ho spiegato! #VaiFradi @carnicats @reddarmy @dekillceesa","id":"10153583362997771"},{"created_time":"2016-01-04T11:06:54+0000","name":"@la_stampa quotidiano di Torino ieri ha pubblicato un pezzo su di me! Gran bella cosa! :)\\n\\n@carnicats @dekillceesa #VaiFradi #CarnicatsLiveBand #DoroGjat #ReddArmy #music #musica #carnia #cjargne #fvg","id":"10153572842952771"},{"created_time":"2015-12-19T12:50:11+0000","name":"Fant\\u00e1ts, volete un''idea per i regali di Natale? Ve la diamo noi! Potete andare alla sede dell''associazione #ReddArmy a Feletto in via Mameli 3 (in orario d''ufficio) e chiedere di Fabrizio @fabrisbrarez che si prender\\u00e0 amorevolmente cura di voi! Troverete tutti i nostri CD e le nostre magliette! ;)\\n\\n#VaiFradi #Carnicats #CarnicatsLiveBand #ReddArmy #music #musica #Carnia #cjargne #fvg @dekillceesa","id":"10153537013132771"},{"created_time":"2015-12-16T17:06:23+0000","name":"Uno scatto de #ilConcertone fatto da Enrico Gatti! Tutto l''album sulla pagina FB dei @carnicats @dekillceesa  #VaiFradi #CarnicatsLiveBand #DoroGjat #musica #music #carnia #cjargne #fvg","id":"10153531459262771"},{"created_time":"2015-12-14T17:12:00+0000","name":"Non vi ringrazier\\u00f2 mai abbastanza per quello che mi avete dato sabato sera. Sia chi era sul palco con me, sia chi era sotto. Vi lovvo infinitamente. \\n\\nDORO GJAT - Carnicats\\n\\n#VaiFradi ReddArmy #ilConcertone\\n\\nphoto by Carla Buscaglia","id":"10153527376692771"},{"created_time":"2015-12-14T09:33:10+0000","name":"Ieri parlavano di #VaiFradi sul #messaggeroveneto (e mi verrebbe da dire anche: finalmente)! Date un occhio a quello che dicono! ;)\\n\\n@carnicats @dekillceesa @davarewahgwaan #Carnicats #CarnicatsLiveBand #DoroGjat #music #musica #Carnia #cjargne #fvg","id":"10153527313942771"},{"created_time":"2015-12-11T12:53:33+0000","name":"Pronti per #ilConcertone di domani? Io mica tanto! Ho le farfalle nello stomaco al solo pensiero! @carnicats @dekillceesa :P\\n\\nINFO: https:\\/\\/goo.gl\\/6TUVo3\\n\\n#VaiFradi #DoroGjat #CarnicatsLiveBand #ReddArmy #musica #music #carnia #cjargne #fvg","id":"10153521750352771"},{"created_time":"2015-12-10T10:09:47+0000","name":"Un caff\\u00e8 e un promemoria..\\n\\nSabato sera @ Padiglione 9 Ente fiera di Udine\\n\\n#ilConcertone\\n#VaiFradi","id":"10153519679702771"},{"created_time":"2015-12-06T17:52:27+0000","name":"Attenzione popolo del web: alle 19:30 sar\\u00f2 intervistato in direttissima dai ragazzi di #beatradio! Parleremo di #VaiFradi , parleremo di hip-hop italiano e parleremo di Musica. Con la M maiuscola, non per niente!\\n\\nIl link per lo streaming \\u00e8 QUI: http:\\/\\/www.spreaker.com\\/user\\/beat-radio\\/06-11-2015-doro-gjat\\n\\n#DoroGjat #ReddArmy #musica #music #Carnia #cjargne #fvg @carnicats","id":"10153513453247771"},{"created_time":"2015-12-05T16:32:28+0000","name":"Per tutti voi che mi state scrivendo perch\\u00e9 volete il disco e non riuscite ad aspettare fino a sabato prossimo, vi comunico che trovate qualche copia (poche, eh!) di #VaiFradi e di #RapParCjargnel in esclusiva all''Angolo della Musica di via Aquileia a Udine!\\n\\nPer tutti gli altri, trovate CD, magliette e tanto amore al banchetto #Carnicats che ci sar\\u00e0 a #ilConcertone di sabato prossimo!\\n\\nINFO: https:\\/\\/goo.gl\\/ml3IbI\\n\\n@carnicats @dekillceesa #DoroGjat #ReddArmy #musica #music #carnia #cjargne #fvg","id":"10153511509417771"},{"created_time":"2015-11-30T09:03:37+0000","name":"Settimo nella classifica degli album hip-hop di iTunes!! Poi in quella generica al 74\\u00b0 e secondo nei top sellers di Amazon! GRAAAAZIEEEE! <3\\n\\nOk, questo \\u00e8 l''ultimo screenshot di classifiche che posto, promesso! :) Il disco \\u00e8 sempre in download ai seguenti link al modico presso di 7,99\\u20ac:\\n\\nItunes: https:\\/\\/goo.gl\\/e2t6A7\\nGoogle Play: https:\\/\\/goo.gl\\/efX4JW\\nAmazon: http:\\/\\/goo.gl\\/BMmPR5\\n\\nE non mancate a #ilConcertone in cui presenter\\u00f2 tutto il disco con la #CarnicatsLiveBand! Info: https:\\/\\/www.facebook.com\\/events\\/920070738083853\\/\\n\\n#DoroGjat #Carnicats #ReddArmy @carnicats @dekillceesa #musica #music #carnia #cjargne #fvg","id":"10153501701872771"},{"created_time":"2015-11-28T19:11:50+0000","name":"Poi vai su Amazon e tra Biagio e la Pausini ci trovi #VaiFradi... E ti dici: \\"macheccazz???\\" :D Tra l''altro due utenti hanno scritto anche la recensione e sono entrambe molto positive! Figo! :)\\n\\nRicordate che il disco \\u00e8 in download sui principali portali digitali a 7,99\\u20ac:\\n\\nItunes: https:\\/\\/goo.gl\\/e2t6A7\\nGoogle Play: https:\\/\\/goo.gl\\/efX4JW\\nAmazon: http:\\/\\/goo.gl\\/BMmPR5\\n\\nE non mancate a #ilConcertone in cui presenter\\u00f2 tutto il disco con la #CarnicatsLiveBand! Info: https:\\/\\/www.facebook.com\\/events\\/920070738083853\\/\\n\\n#VaiFradiVideo #DoroGjat #ReddArmy #CarnicatsLiveBand @carnicats @dekillceesa #music #musica #carnia #cjargne #fvg","id":"10153499150302771"},{"created_time":"2015-11-27T09:07:58+0000","name":"Uno si sveglia la mattina, apre iTunes e (con un filo di malizia) d\\u00e0 un occhio alla classifica per vedere che c''\\u00e8 di nuovo... SEISO MATS FANT\\u00c1TS???\\n\\nGRAAAAZIEEEE!!! #VaiFradi \\u00e8 entrato di prepotenza con tutti i brani! Vi lovvo tantissimo! :)\\n\\nFacciamolo salire ancora un po''! Per chi ancora non l''ha sentito pu\\u00f2 fare play alle preview sui digital stores:\\n\\nItunes (al momento sono scaricabili solo le singole tracce, una per una): https:\\/\\/goo.gl\\/e2t6A7\\nGoogle Play: https:\\/\\/goo.gl\\/efX4JW\\nAmazon: http:\\/\\/goo.gl\\/BMmPR5\\n\\n#VaiFradi #DoroGjat @carnicats @dekillceesa #CarnicatsLiveBand #ReddArmy #music #musica #carnia #cjargne #fvg","id":"10153496935217771"},{"created_time":"2015-11-26T16:58:39+0000","name":"Ciao fant\\u00e0ts, i feedback che mi state dando a proposito di #VaiFradi sono FENOMENALI! Grazie! Sono immensamente felice che vi stia piacendo cos\\u00ec tanto!\\n\\nRicordatevi che il 12 dicembre lo presenter\\u00f2 con tutta la #CarnicatsLiveBand al padiglione fiera di Udine! Sar\\u00e0 un evento fighissimo, lo stiamo preparando fin nei minimi dettagli: ci saranno tutti gli ospiti del disco, aggiungeremo fiati, percussioni, piano e synth... Insomma, una roba figa che sono sicuro vi piacer\\u00e0!\\n\\nINFO EVENTO: https:\\/\\/www.facebook.com\\/events\\/920070738083853\\/\\n\\nAd ogni modo ricordatevi che il disco \\u00e8 scaricabile da tutti i digital stores a 7,99\\u20ac:\\n\\nItunes (al momento sono scaricabili solo le singole tracce, una per una): https:\\/\\/goo.gl\\/e2t6A7\\nGoogle Play: https:\\/\\/goo.gl\\/efX4JW\\nAmazon: http:\\/\\/goo.gl\\/BMmPR5\\n\\n#VaiFradiVideo #DoroGjat\\n#Carnicats  @carnicats @dekillceesa #music #musica #carnia #cjargne #fvg","id":"10153495479272771"},{"created_time":"2015-11-25T13:21:09+0000","name":"Grazie a @ilmanifesto per il bel articolo! Da oggi trovate #VaiFradi sui principali digital stores! Dateci dentro!\\n\\nItunes: https:\\/\\/goo.gl\\/zINXSy\\nGoogle Play: https:\\/\\/goo.gl\\/efX4JW\\nAmazon: http:\\/\\/goo.gl\\/BMmPR5\\n\\n#VaiFradiVideo #DoroGjat #ReddArmy @carnicats @dekillceesa @davarewahgwaan","id":"10153493409962771"},{"created_time":"2015-11-24T13:24:42+0000","name":"Un''enorme cimice sputafuoco! Questo e altro nel #VaiFradiVideo che, tra le altre cose, \\u00e8 anche in rotazione su @hiphoptvitaly per tutta la settimana!\\n\\nE ricordate che:\\n\\n1) l''album sar\\u00e0 scaricabile da iTunes a partire da DOMANI al modico prezzo di 7,99\\u20ac, per tutti voi che non avete potuto acquistare il CD!\\n2) sabato 12 dicembre faremo un concertone al Padiglione Fiera di Udine (info qui: https:\\/\\/goo.gl\\/FomdsB)\\n3) potete guardarvi il video ancora una volta qui: https:\\/\\/youtu.be\\/UA6JZpEIFFY\\n\\n#VaiFradi #DoroGjat @carnicats #ReddArmy #musica #music #carnia #cjargne #fvg","id":"10153491763417771"},{"created_time":"2015-11-23T12:41:04+0000","name":"#IlFriuli parla di #VaiFradi nel numero di questa settimana! E ne parla pure parecchio bene, devo dire! ;)\\n\\nRicordate che:\\n\\n1) l''album sar\\u00e0 scaricabile da iTunes a partire da mercoled\\u00ec;\\n2) sabato 12 dicembre faremo un concertone al Padiglione Fiera di Udine (info qui: https:\\/\\/goo.gl\\/FomdsB)\\n3) potete guardarvi il video ancora una volta (visto che l''avete gi\\u00e0 fatto per pi\\u00f9 di DODICIMILAVOLTE) qui: https:\\/\\/youtu.be\\/UA6JZpEIFFY\\n\\nG R A Z I E\\n\\n@dekillceesa @carnicats #musica #music #fvg #CarnicatsLiveBand #Carnicats #reddarmy #cjargne #carnia","id":"10153490129252771"},{"created_time":"2015-11-21T11:04:05+0000","name":"La t-shirt #VaiFradi \\u00e8 una bomba, lo so! Potete comprarne una oggi alle 18:00 all''Angolo della Musica! \\n\\n#DoroGjat @carnicats @dekillceesa #ReddArmy #music #musica #carnia #cjargne #fvg","id":"10153486579737771"},{"created_time":"2015-11-20T19:49:33+0000","name":"Domani vender\\u00f2 le prime copie di #VaiFradi!! Ho investito in questa cosa due anni e mezzo della mia vita, ci messo la mente, il cuore e le spalle. \\u00c8 tipo il mio segno della croce!\\n\\nDomani lo avrete tra le mani, spero che vi susciti le stesse sensazioni che io ancora provo quando schiaccio play.Ci vediamo alle 18:00 all''Angolo della Musica! \\n\\nE non dimenticate che:\\n\\n- lo potrete scaricare da iTunes e da tutti i digital stores a partire da mercoled\\u00ec 25;\\n- lo potrete sentire suonato dal vivo con la #CarnicatsLiveBand il 12.12 @ Padiglione Fiera di Udine\\n\\n#DoroGjat @carnicats @dekillceesa @davarewahgwaan  #reddarmy #music #musica #carnia #cjargne #fvg \\n\\nPhoto by Daniele Schiavo\\nGraph by Filippo Marra @filmarra","id":"10153485561277771"},{"created_time":"2015-11-20T10:56:12+0000","name":"Robe da non credere #Pais\\u00e0ns! Ci siamo presi l''#hhtvpass e dalla prossima settimana il #VaiFradiVideo sar\\u00e0 in rotazione su #hhtv! Pi\\u00f9 #VaiFradi  di cos\\u00ec si muore! @carnicats @dekillceesa @hiphoptvitaly","id":"10153484745242771"},{"created_time":"2015-11-19T19:31:15+0000","name":"Oggi #IlGazzettino ha parlato di #VaiFradi! Un ringraziamento a #DavidZanirato, sempre sul pezzo!\\n\\nTenete d''occhio i prossimi appuntamenti! Ce n''\\u00e8 anche uno nuovo di cui ancora non sapevate! ;)\\n\\n21.11.15 ---> instore @ Angolo della Musica (UD)\\n25.11.15 ---> il disco in vendita su tutti i digital stores\\n12.12.15 ---> VAI FRADI RELEASE PARTY feat. #CarnicatsLiveBand  @ Padiglione Fiera (UD) !!!!\\n\\n@carnicats @dekillceesa #DoroGjat #carnicats #reddarmy #musica #music #carnia #cjargne #fvg #fvglive","id":"10153483741522771"},{"created_time":"2015-11-17T13:54:25+0000","name":"#road2VaiFradi episode 26\\n\\nPronti per vedere il #VaiFradiVideo? Dopo un mese di anticipazioni, video, GIFs, spccamenti di palle... Ci siamo quasi! Patton, generale d''acciaio, accompagnato dal sergente Fragano,da un inquietante signore in nero con tanto di fez e da una cimice gigante sputafuoco (direttamente dalla compagniadi teatro di strada @Ratatuie)! Domani \\u00e8 il gran giorno, preparate il dito destro per scatenare l''inferno delle condivisioni!\\n\\nVideo OUT ---> TOMORROW!!\\nInstore @Angolo della Musica ---> 21.11.15 \\/\\/ h 18:00\\nAlbum OUT ---> 25.11.15\\n\\n#VaiFradiVideo #ReddArmy  #carnicats #DoroGjat #musica #music #carnia #cjargne #fvg @carnicats \\n\\nPhoto by #davidecristin","id":"10153479964487771"},{"created_time":"2015-11-11T13:30:06+0000","name":"#road2VaiFradi episode 22\\n\\nOrmai manca solo una settimana al #VaiFradiVideo e la lunga strada che ci ha portati fino a qui \\u00e8 quasi finita! Siete pronti? Direzione: #Carnia! Stiamo arrivando!\\n\\n(E grazie ad Alessandro Nettis per l''indicazione stradale! Una bella sunetta in reggicalze non avrebbe saputo fare di meglio!)\\n\\nVideo OUT ---> 18.11.16\\nInstore Angolo della Musica ---> 21.11.15 \\/\\/ h 18:00\\nAlbum OUT ---> 25.11.15\\n\\n#VaiFradiVideo #ReddArmy  #carnicats #DoroGjat #musica #music #carnia #cjargne #fvg @carnicats\\n\\nPhoto by #davidecristin","id":"10153470197042771"},{"created_time":"2015-11-09T14:00:36+0000","name":"#road2VaiFradi episode 21\\n\\nInvece del consueto #VaiFradi oggi devo scrivere per forza #VaiSur perch\\u00e8 quella che vedete al volante \\u00e8 la mia splendida sorella @sdrthy che di mestiere fa l''osteopata a.k.a. ti spezza le ossa. L''altro disadattato impellicciato \\u00e8 invece mio fratello @TOIO86 #benatti che, non si sa come, ha un hashtag con un casino di repost! :P\\n\\nVideo OUT --->  18.11.15\\nAlbum OUT ---> 25.11.15\\n\\n#VaiFradiVideo #ReddArmy  #carnicats #DoroGjat #musica #music #carnia #cjargne #fvg @carnicats\\n\\nPhoto by #davidecristin","id":"10153467136582771"}]', 9),
